# Definition for a binary tree node.# class TreeNode:#     def __init__(self, x):#         self.val = x#         self.left = None#         self.right = Noneclass Solution(object):    def generateTrees(self, n):        def buildBST(nums):            if not nums:                 return [None]            res=[]            for i in range(len(nums)):                for left in buildBST(nums[:i]):                    for right in buildBST(nums[i+1:]):                        root, root.left, root.right=TreeNode(nums[i]), left, right                        res += [root]            return res        if n == 0:            return []        return buildBST(list(range(1, n+1)))        